<style type="text/css">

.tocify {
width: 20%;
max-height: 90%;
overflow: auto;
margin-left: 2%;
position: fixed;
border: 1px solid #ccc;
border-radius: 6px;
}

.tocify ul, .tocify li {
list-style: none;
margin: 0;
padding: 0;
border: none;
line-height: 30px;
}

.tocify-header {
text-indent: 10px;
}

.tocify-subheader {
text-indent: 20px;
display: none;
}

.tocify-subheader li {
font-size: 12px;
}

.tocify-subheader .tocify-subheader {
text-indent: 30px;
}
.tocify-subheader .tocify-subheader .tocify-subheader {
text-indent: 40px;
}
.tocify-subheader .tocify-subheader .tocify-subheader .tocify-subheader {
text-indent: 50px;
}
.tocify-subheader .tocify-subheader .tocify-subheader .tocify-subheader .tocify-subheader {
text-indent: 60px;
}

.tocify .tocify-item > a, .tocify .nav-list .nav-header {
margin: 0px;
}

.tocify .tocify-item a, .tocify .list-group-item {
padding: 5px;
}
.tocify .nav-pills > li {
float: none;
}


</style>

      var selector = hash ? 'a[href="' + hash + '"]' : 'li.active > a';

    });

});
